        public int[,] GetLayout(int index)
        {
            // Ensure the index is valid
            if (index >= 0 && index < layouts.Count)
            {
                GameGlobals.currentMapLayout = index;
                return layouts[index];
            }
            else
            {
				System.Diagnostics.Debug.WriteLine($"Current MapLayout: {index}");
				throw new IndexOutOfRangeException("Layout index is out of range.");
            }
        }




